    true,nt"url": null,nt"notes": "A map service on the www that depicts Collaborative
    Forest Landscape Restoration (CFLR) and High Priority Restoration (HRP) project
    accomplishments. These are ten year projects designed to encourage the collaborative,
    science-based ecosystem restoration of priority forest landscapes. Please note that
    this data does not contain all activities that are part of CFLR since spatial reporting
